import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css'

const Contact = () => {
  const [context, setContext] = useState(null);
  const [posts, setPosts] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Handling Two API endpoints
    const fetchContext = axios.get('http://127.0.0.1:8000/api/my_context/');
    const fetchPosts = axios.get('http://127.0.0.1:8000/api/posts/');

    Promise.all([fetchContext, fetchPosts])
      .then(([contextResponse, postsResponse]) => {
        setContext(contextResponse.data.my_info);
        setPosts(postsResponse.data);
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error.message}</div>;

  return (
    <div>
      <h1>Contact Page</h1>
      {context && <p className="title">{context.my_title}</p>}
      {Array.isArray(posts) && posts.map(post => (
        <div key={post.id} className="post-list"> {/* Add a parent div with a unique key */}
          <h2>{post.title}</h2>
          <p>{post.content}</p>
          <h4>{post.comment_line}</h4>
        </div>
      ))}
    </div>
  );
};

export default Contact;
